    const handleShow = () => setShow(true)
    return (
        <div>
            <Button variant="success" onClick={handleShow}>Check this request</Button>
            {/* <Modal show={show} onHide={handleClose} backdrop="static" keyboard={false} variant="modal-lg"> */}
            <Modal
        show={show}
        onHide={() => setShow(false)}
        dialogClassName="modal-lg"
      >
                <Modal.Header closeButton>
